import React, { useState } from "react";

function Guess() {
  const [input, setInput] = useState("");
  return (
    <>
      <form class="guess-input-wrapper">
        <label for="guess-input">Enter guess:</label>
        <input
          maxlength="6"
          id="guess-input"
          type="text"
          onChange={(e) => {
            setInput(e.target.value);
          }}
        />
      </form>
      <h1>{input}</h1>
    </>
  );
}

export default Guess;
